    data () {
        return {
            tableData: [{
                rawMaterialCost:null,
                recoveryValue:null,
                outsourcingCost:null,
                toolingCost:null,
                processingCost:null,
                wasteLoss:null,
                designCost:null,
                managementRate:null,
                managementCost:null,
                financialRate:null,
                financialCost:null,
                packingCost:null,
                logisticsCost:null,
                otherCost:null,
                profitRate:null,
                profit:null,
                realPrice:null
            }],
            tableConfig: [
                { label: '序号', fixed: true, prop: 'prop1', align: 'center', width: 'auto' },
                {
                    label: '制造总费用', prop: 'no1', align: 'center', width: 'auto',
                    innerArr: [
                        { label: '原材料费用', prop: 'rawMaterialCost', align: 'center', width: 'auto' },
