                        { label: '加工费用', prop: 'processingCost', align: 'center', width: 'auto' },
                        { label: '废品损失', prop: 'wasteLoss', align: 'center', width: 'auto' },
                    ]
                },
                {
                    label: '期间费用', prop: 'no2', align: 'center', width: 'auto',
                    innerArr: [
                        { label: '设计/实验费用', prop: 'designCost', align: 'center', width: '120' },
                        { label: '管理费率', prop: 'managementRate', align: 'center', width: 'auto' },
