                { label: '核实价', prop: 'realPrice', align: 'center', width: 'auto' },
            ]
        }
    },
    methods: {
        changeFormValue(prop,val){
            this.$set(this.tableData[0],prop,val)
        },
        initTable(tdata){
            this.tableData = [{
                rawMaterialCost:null,
                recoveryValue:null,
                outsourcingCost:null,
                toolingCost:null,
                processingCost:null,
                wasteLoss:null,
                designCost:null,
                managementRate:null,
                managementCost:null,
                financialRate:null,
                financialCost:null,
                packingCost:null,
                logisticsCost:null,
                otherCost:null,
                profitRate:null,
                profit:null,
                realPrice:null
            }]
            for(let par in this.tableData[0]){
                for(let pari in tdata){
                    if(pari===par){
                        this.tableData[0][par] = tdata[pari]
                    }
                }
            }
            this.$set(this.tableData,'0',this.tableData[0])
        }
    }
